import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
        <Route exact path="/" component={Home} />
        <Route path="/articles" component={Work} />
        <Route path="/about" component={About} />

      <div className="navigation">
        <div className="navigation-sub">
          <Link to="/components/home" className="item">Home</Link>
          <Link to="/components/work" className="item">Work</Link>
          <Link to="/components/about" className="item">About</Link>
        </div>

      </div>
    </div>
  );
}

export default App;
